import "./Navbar.scss";
import { useState } from "react";

function Intro() {
  // toggleNavbar = () => {};
  const [isActive, setActive] = useState("false");

  function toggleNavbar() {
    alert("Hello!");
  }
  const handleToggle = () => {
    setActive(!isActive);
  };
  return (
    <div>
      <nav class="navbar">
        <div class="brand-title">Brand Name</div>
        <a href="#" class="toggle-button" onClick={handleToggle}>
          <span class="bar"></span>
          <span class="bar"></span>
          <span class="bar"></span>
        </a>
        <div class="navbar-links">
          <ul>
            <li>
              <a href="#">Home</a>
            </li>
            <li>
              <a href="#">About</a>
            </li>
            <li>
              <a href="#">Contact</a>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Intro;
